import React from 'react';
import './ProductSecSection.css';

const ProductSecSection = () => {
  return (
    <div className="product-container">
      <div className="box">
        <p>Startup</p>
        <div className="price">
          <span className="amount">$800</span> <span className="description">WITH ITS POWER</span> <span className="per-month">/MONTH</span>
        </div>
      </div>
      <div className="box"></div>
    </div>
  );
}

export default ProductSecSection;
